from collections import deque
from typing import List

class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        gridSize = len(grid)
        if grid[0][0] == 1: return -1
        queue = deque()
        start = [0,0]
        queue.append([start,1])
        minPath = 500
        grid[start[0]][start[1]] = -1 
        while len(queue) > 0:
            [pos, path] = queue.popleft()
            if pos[0] == gridSize-1 and pos[1] == gridSize-1:
                return path
            directions = [
                [-1,-1],[-1,0],[-1,1],
                [0, -1],[0, 0],[0, 1],
                [1, -1],[1, 0],[1, 1]
            ]
            for i in directions:
                if (pos[0] + i[0]) >= gridSize or (pos[0]+i[0]) < 0:
                    continue
                if (pos[1] + i[1]) >= gridSize or (pos[1]+i[1]) < 0:
                    continue
                newPosX = pos[0] + i[0]
                newPosY = pos[1] + i[1]
                if grid[newPosX][newPosY] == 1 or grid[newPosX][newPosY] == -1:
                    continue
                # This line will prevent the duplicates path pushing to the queue.
                # The queue length is keep on increasing due to multiple duplicate paths
                # because in BFS main issue will be with the multiple paths
                grid[newPosX][newPosY] = -1
                queue.append([[newPosX,newPosY],path+1])
        
        return -1
        

